import React from 'react';
import { Text, View } from 'react-native';
import AppText from '../../components/text/AppText';

const MenusScreen = () => {
    return (
        <View>
            <View>
                <AppText>Name</AppText>
                <AppText>Edit Personal Information</AppText>
            </View>
        </View>
    );
}

export default MenusScreen;
